import React from 'react';
import BarChart from './BarChart';
import LineChart from './LineChart';
import ScatterPlot from './ScatterPlot';

const Visualization = ({ stocks, visualizationType, sortKey }) => {
  const renderVisualization = () => {
    switch (visualizationType) {
      case 'bar':
        return <BarChart data={stocks} sortKey={sortKey} />;
      case 'line':
        return <LineChart data={stocks} sortKey={sortKey} />;
      case 'scatter':
        return <ScatterPlot data={stocks} sortKey={sortKey} />;
      default:
        return <BarChart data={stocks} sortKey={sortKey} />;
    }
  };

  return (
    <div className="visualization-container">
      {renderVisualization()}
    </div>
  );
};

export default Visualization;
